Dashmix.onLoad((() => class {
    static initValidation() {
        Dashmix.helpers("jq-validation"), jQuery(".js-validation-lock").validate({
            rules: {
                "password": {
                    required: !0,
                    minlength: 8,
                    maxlength: 8
                }
            },
            messages: {
                "password": "Lütfen 8 rakamdan oluşan parola belirleyin"
            }
        })
    }
    static init() { this.initValidation() }
}.init()));